import React from 'react';
import { Link } from 'react-router-dom';

const Projects = () => {
  return (
    <div className="max-w-7xl mx-auto px-4 sm:px-6 lg:px-8 py-8">
      <h1 className="text-3xl font-bold text-gray-900 mb-8">Projects</h1>
      
      <div className="bg-white shadow rounded-lg p-6">
        <p className="text-lg text-gray-700 mb-4">
          Welcome to our projects page. Here you can find information about our various initiatives and accomplishments.
        </p>
        
        <p className="text-lg text-gray-700 mb-6">
          Please check out our <Link to="/assignment" className="text-blue-600 hover:text-blue-800 underline">Assignments</Link> section to see our latest work and portfolio.
        </p>

        <div className="mt-8">
          <h2 className="text-2xl font-semibold text-gray-900 mb-4">Our Approach</h2>
          <p className="text-gray-700">
            We focus on delivering high-quality results through careful planning, innovative solutions, and attention to detail. 
            Each project represents our commitment to excellence and client satisfaction.
          </p>
        </div>
      </div>
    </div>
  );
};

export default Projects;
